import gql from "graphql-tag";

export const MY_PROFILE = gql`
      query MY_PROFILE {
            user {
                  id
                  username
                  email
                  profile {
                        id
                        firstname
                        lastname
                        age
                        birthdate
                        mentalStatus
                        profileImage
                  }
            }
      }
`;

export const CREATE_PROFILE = gql`
        mutation CREATE_PROFILE(
            $firstname: String!
            $lastname: String!
            $birthdate: String!
            $age: Int
            $gender: String!
            $mentalStatus: String!
            $profileImage: String!
            $coverImage:String!
        ){

        }
  `;
